import { BusquedaDescarteModel, UsuarioProspectoModel } from "../../models";
import DocumentoAnexoModel from "../../models/Backend/DocumentoAnexoModel";
import IgrInboxResultModel from "../../models/InformeGestion/InboxResultModel";
import ApiService from "../ApiServiceBackend";
import * as url from "../../helpers/url_helper"
import * as opt from "../../helpers/options_helper"
import qs from 'qs';
import moment from "moment";

export default class Services extends ApiService {

  //Login de Usuario
  async getUserInfo(userName, password) {
    try {
      var data = qs.stringify({ userName: userName, password: password });
      var result = await this.get(url.URL_BACKEND_LOGINUSUARIO + "?" + data);

      /*
      {
      "userprincipalName": ": usrcredcomercial@Panama.Banesco.Lac",
      "displayName": " usrcredcomercial",
      "userName": "usrcredcomercial",
      "givenName": ": usrcredcomercial",
      "ldapFlag": 0,
      "mobile": null,
      "phone": null,
      "email": null
    }
      */

      return result;
    }
    catch (err) {
      console.error("api error guardarHistorico", err)
    }
    return undefined;
  }

  async guardarDocumentoAnexo(data) {

    var result = await this.post(url.URL_BACKEND_DOCUMENTS, data);
    /*
    {
    "documentIdentification": 291,
    "status": {
        "statusCode": "200",
        "statusDesc": "Transacciï¿½n Exitosa"
    }
}
    */
    if (result.status.statusCode === "200") { return true; }

    return false;
  }

  async eliminarDocumentoAnexo(data) {
    data = qs.stringify(data);
    var result = await this.del(url.URL_BACKEND_DOCUMENTS + "?" + data);
    /*OK
    {
      "statusCode": "200",
      "statusDesc": "Transacciï¿½n Exitosa"
    }
    */
    console.log("eliminarDocumentoAnexo", result);
    if (result.statusCode === "200") { return true; }

    return false;
  }

  async consultarDocumentosAnexos(params) {

    //params = {transactId:55,processId:'fff',activityId:'458-956-875'}
    var data = qs.stringify(params);
    var result = await this.get(url.URL_BACKEND_DOCUMENTSANEXOS + "?" + data);

    /*
    {
    "attachments": [
        {
            "transactId": 8,
            "documentIdentification": 291,
            "fileName": "text",
            "fileDescription": "description",
            "onBaseIdentification": "556",
            "processId": 5,
            "activityId": 1,
            "date": "2022-01-23",
            "status": true
        }
    ],
    "status": {
        "statusCode": "200",
        "statusDesc": "Transacción Exitosa"
    }
}
    */

    if (result.status.statusCode === "200") {
      return result.attachments;
    }

    return undefined;
  }
  /* ---------------------------------------------------------------------------------------------- */
  /*                  Recibimos el body desde la pantalla, y Guardamos la bitacora                  */
  /* ---------------------------------------------------------------------------------------------- */
  async guardarHistorico(data) {
    try {
      var result = await this.post(url.ULR_BACKEND_HISTORICO, data);
      if (result.statusCode === "200") {
        return result;
      }
    }
    catch (err) {
      console.error("api error guardarHistorico", err)
    }
    return undefined;
