  //ORQUESTADO PERSONA SOLICITUD - BUSQUEDA Y DESCARTE
  async consultarOrquestadoListaPersonaSolicitud(transactId) {
    try {

      //consultamos todas las personas
      var listaPersona = await this.consultarListaPersonaSolicitud(transactId);
      var listaRoles = await this.consultarRolPersona(transactId);
      var listaVigilancia = await this.consultarListaVigilanciaPersona(transactId);

      listaPersona.map(async function (item, i) {
        var mrole = listaRoles.find((itemrole) => {
          return itemrole.personId === item.personId;
        })
        if (mrole !== undefined && mrole !== null) {
          item["roles"] = mrole.roles;
        }
      })

      listaPersona.map(async function (item, i) {
        var vigilancia = listaVigilancia.find((itemvigilancia) => {
          return itemvigilancia.personId === item.personId;
        })
        if (vigilancia !== undefined && vigilancia !== null) {
          item["watchList"] = vigilancia;
        }
      })

      return listaPersona;
    }
    catch (err) {
      console.error("api consultarListaDesembolsoPropCred: ", err)
    }
    return undefined;
  }
  async nuevoOrquestadoListaPersonaSolicitud(data) {
