      var resultPerson = await this.nuevoPersonaSolicitud(data);
      for (var i = 0; i < data.roles.length; i++) {
        await this.nuevoRolPersona({
          transactId: data.transactId,
          personId: resultPerson.personId,
          roleId: data.roles[i],
          status: true
        });
      }

      for (var i = 0; i < data.blacklist.length; i++) {
        data.blacklist[i].transactId=data.transactId;
        await this.nuevoListaVigilanciaPersona({
          transactId: data.transactId,
          personId: resultPerson.personId,
          roleId: data.blacklist[i],
          status: true
        });
      }

      if (data.blacklist !== undefined) {
        var resulBlackList = await this.nuevoListaVigilanciaPersona(data.blacklist);
      }

      return resultPerson;
